description:
The Pirats! Band Of Misfits 2012 CAM XVID Animatie/Avontuur


[img]http://img138.imageshack.us/img138/1641/piratesbandmisfitsposte.jpg[/img]



Verenigd Koninkrijk / Verenigde Staten
Animatie / Avontuur
88 minuten



geregisseerd door Peter Lord en Jeff Newitt
met de stemmen van Hugh Grant, Salma Hayek en Martin Freeman



Een niet al te succesvolle, chaotische en bebaarde piraten-kapitein (Hugh Grant) moet samen met zijn crew hun grote droom waar maken, namelijk de bittere rivalen Black Bellamy en Cutlass Liz verslaan om de grote prijs; 'Piraat van het Jaar'. Tussen de hevige strijd en het grote avontuur door ontmoeten de piraten onder andere de bekende Charles Darwin en een pratende chimpansee.




vertaald door Tokke,Quicksilver en Suurtje Simply Releases Toppers



